import './style.css';

const Demo = (props) => {
  const values = props.values;
  const setValues = props.setValues;
  return(
    <div className="Demo">
      <header>VLEAP</header>
      <ul>
        <li 
          className={ values.tabs[0] == 0 ? 'selected' : '' }
          style={{order: values.tabs[0]}}
          name={values.tabs[0]}
          onClick={() => setValues({...values, tabs: [0,1,2,3]})}
        >ライトプラン</li>
        <li 
          className={ values.tabs[1] == 0 ? 'selected' : '' }
          style={{order: values.tabs[1]}}
          name={values.tabs[1]}
          onClick={() => setValues({...values, tabs: [3,0,1,2]})}
        >カスタムプラン</li>
        <li 
          className={ values.tabs[2] == 0 ? 'selected' : '' }
          style={{order: values.tabs[2]}}
          name={String(values.tabs[2])}
          onClick={() => setValues({...values, tabs: [2,3,0,1]})}
        >アニメーションプラン</li>
        <li
          className={ values.tabs[3] == 0 ? 'selected' : '' }
          style={{order: values.tabs[3]}}
          name={values.tabs[3]}
          onClick={() => setValues({...values, tabs: [1,2,3,0]})}
        >従来のサイト</li>
      </ul>
      <div className="DemoContent">
        <div className="planTips">
          {
            values.tabs[0] == 0 ? 'a' 
            : values.tabs[1] == 0 ? 'b' 
            : values.tabs[2] == 0 ? 'c' 
            : values.tabs[3] == 0 ? 'd' 
            : undefined
          }
          <div className="manual">
            操作説明<br/>
            <span role="img" aria-label="ああ" className='icon'></span>
          </div>
        </div>
        <div className="canvas">b</div>
      </div>
    </div>
  )
}

export default Demo;
